handoff_protocol:
  branch_pattern: ^phase[0-9]+\.[a-z]{2}[0-9]+\.[0-9]+(\.i[0-9]{2})?$
  commit_subject_pattern: '^phase[0-9]+ [a-z]{2}[0-9]+\.[0-9]+: .+$'
  required_commit_body_tokens:
  - 'Checkbox:'
  - 'Invariant:'
  - 'Proof/Test:'
  - 'Docs:'
  required_gate_scripts:
  - scripts/check_canonical_execution_model.sh
message_transition_policy:
  initial_statuses:
  - queued
  - sent
  terminal_statuses:
  - rejected
  - rescinded
  - closed
  allowed_transitions:
  - from: queued
    to: sent
  - from: queued
    to: rescinded
  - from: sent
    to: queued
  - from: sent
    to: acknowledged
  - from: sent
    to: rescinded
  - from: acknowledged
    to: sent
  - from: acknowledged
    to: fulfilled
  - from: acknowledged
    to: rejected
  - from: acknowledged
    to: closed
  - from: fulfilled
    to: ingested
  - from: ingested
    to: closed
